instance.peoplecode_text:
Declare Function UserClause PeopleCode FUNCLIB_PTSEC.OPRID FieldFormula;
Declare Function UpdateSystemVersions PeopleCode FUNCLIB_PTSEC.OPRID FieldFormula;
Declare Function UpdatePSLOCK PeopleCode FUNCLIB_PTSEC.OPRID FieldFormula;
Declare Function UpdateOprVersion PeopleCode FUNCLIB_PTSEC.OPRID FieldFormula;

/* Function called from Signon PeopleCode */
Function setTheme

   /* Variable Declaration */
   Local any &RW_anyVersion, &RW_anyClause;
   Local string &RW_strTheme, &RW_strOprID;
   Local string &RW_strThemeSet = "N";

   &RW_strOprID = %SignonUserId;

   /* Get theme set in preferences */
   SQLExec("SELECT B.PTBR_THEME_ID FROM PSUSERPRSNLOPTN A, PS_RW_THEME_VW B WHERE A.USER_OPTION_VALUE = B.DESCR AND A.USEROPTN = 'RW_THEME' AND A.OPRID = :1", &RW_strOprID, &RW_strTheme);

   /* Check if role already assigned */
   SQLExec("SELECT 'Y' FROM PSROLEUSER WHERE ROLEUSER = :1 AND ROLENAME = :2", &RW_strOprID, &RW_strTheme, &RW_strThemeSet);

   /* Only set a new role if the role is not already set and the role/theme combination exists */
   If &RW_strThemeSet <> "Y" And
         All(&RW_strTheme) Then

      /* Remove any existing theme roles */
      SQLExec("DELETE FROM PSROLEUSER WHERE ROLEUSER = :1 AND ROLENAME IN (SELECT PTBR_THEME_ID FROM PS_RW_THEME_VW)", &RW_strOprID);

      /* Insert new theme role */
      SQLExec("INSERT INTO PSROLEUSER VALUES (:1,:2,'N')", &RW_strOprID, &RW_strTheme);

      /* Update operator version after role change */
      &RW_anyClause = " = '" | &RW_strOprID | "'";
      UpdatePSLOCK();
      &RW_anyVersion = UpdateSystemVersions();
      UpdateOprVersion(&RW_strTheme, &RW_anyClause, &RW_anyVersion);
   End-If;

End-Function;
